import React, { useState, useEffect } from "react";
import "./App.css";
import Post from "./Post";

function App() {
  const [posts, setPosts] = useState([
    {
      username: "random girl",
      caption: "wow it works",
      imageUrl:
        "https://i1.wp.com/www.thesun.co.uk/wp-content/uploads/2020/03/NINTCHDBPICT000432826903.jpg?crop=22px%2C0px%2C928px%2C928px&resize=960%2C960&ssl=1",
    },
    {
      username: "random dog",
      caption: "wow it works dog",
      imageUrl:
        "https://www.sciencemag.org/sites/default/files/styles/article_main_large/public/dogs_1280p_0.jpg?itok=cnRk0HYq",
    },
  ]);

  return (
    <div>
      <div className="app__header">
        <img
          src="https://lh3.googleusercontent.com/LZdsQGEbRqcZIjvWdiJTjlaGQJQjP097FAIvl4XfOi_XHagmC83Lc04PDxaq8Ml6xJk"
          alt=""
          className="app__headerImage"
        />
      </div>
      <h1>HELLO CLERVER MOTHER FUCKERS !!!!!!!! build instagrams bitch </h1>
      {posts.map((post) => {
        return (
          <Post
            key={post.imageUrl}
            username={post.username}
            caption={post.caption}
            imageUrl={post.imageUrl}
          />
        );
      })}
    </div>
  );
}

export default App;
